        "relative_time_description": "in the last week",
        "text": "Stayed here one night and was quite satisfied. The room was clean and the bed comfortable. The pool is nice on the fifth floor. Location is great if you're wanting to be downtown. Found the restaurant quite pricey though. Still would stay there again!",
