        "language": "en",
        "rating": 5,
        "relative_time_description": "2 months ago",
        "text": "The staff was extremely helpful and went out of their way make our stay perfect. My SO was battling a cold and even at 3 in the morning they found her some tea. Hotel room was nice and clean. Also appreciated that they don't make you put a $250 deposit down like some hotels in the area. Will be going back for sure.",
