        "profile_photo_url": "//lh6.googleusercontent.com/-lAbdSlQ6log/AAAAAAAAAAI/AAAAAAAAAsI/qy2yYmdVRng/s128/photo.jpg",
        "rating": 3,
        "relative_time_description": "6 months ago",
        "text": "Food was moderately priced. I got a burger and wine deal that was pretty good. My wife got a chicken plate that was seasoned and prepared well. We just felt the food was a little too salty. That might just be how French food is prepared. \n\nThe layout inside seems pretty cool. Looks like it would be a good wine place to chill in the evening. ",
        "time": 1469193019
