        "rating": 5,
        "relative_time_description": "a month ago",
        "text": "If I could move in I would. The best Indian food in Ottawa. Love this place my partner and I go once in a while and we love it. It clean, Friendly staff and very awesome food. I mean super yummy food.",
        "time": 1482150606
