        "rating": 5,
        "relative_time_description": "a month ago",
        "text": "The preamble: In fairness to restaurants we didn’t care for, we have omitted reviewing them. If your restaurant doesn't have a review on our board, we either didn’t love it, or we haven’t eaten there yet. If you are interested in having us dine at your establishment, send us a note and well get you on our list for future meals. We’re not here to trash the restaurants we believe have some work ahead of them, rather to applaud the restaurants we feel are above the bar.\n\nIncredible brunch and lunch menus (sorry, no dinners). Go just after the lunch rush Monday to Friday, or show up early for the very busy weekend brunch. Interesting and sometimes changing menu including poached eggs, yukon potatoes and smoked salmon, or my favourite beautiful tuna loin with smoked tomato broth, chorizo balls and poached eggs. Great friendly service and interesting menu make this a must try place.",
        "time": 1480877490
