        "rating": 4,
        "relative_time_description": "6 months ago",
        "text": "Nice place tucked behind the store front bakery. The service was friendly, and quite timely considering it was prime time for brunch on a Saturday. We had a 10 minute wait for a seat for two. The Kir Kir cocktail was great as was the hanger steak special. Expect to pay $15-20 each meal plus drinks which is reasonable for the quality of the food. Very flavorful. ",
