    "reference": "CmRSAAAAAP1ZC38ojopWvzQSAW-6XpMJg6Z8zu2ksWAbVi3uLwGjPb_p79yb1ms58BuHJ1gPwtGn5OPPEEzT4GGk6vubxwx7HdAigp8e2pyWnmJBqomSRmngaBUSTYvPCOE954sHEhAcLWZsjQya0C6rhEHvESGkGhT36HMhwObP_evL2TnuzQRk8MtIVg",
    "reviews": [
      {
        "aspects": [
          {
            "rating": 0,
            "type": "overall"
          }
        ],
        "author_name": "Jordan Alcock",
        "author_url": "https://www.google.com/maps/contrib/113195702878255385482/reviews",
        "language": "en",
        "profile_photo_url": "//lh5.googleusercontent.com/-5_gubAhtrD0/AAAAAAAAAAI/AAAAAAAAAHM/Xtn3BU89Vqs/s128/photo.jpg",
        "rating": 2,
        "relative_time_description": "in the last week",
        "text": "This is a restaurant review...  We all know IKEA so reviewing the store isn't necessary.  The restaurant used to be awesome.  Breakfast was affordable, a good value.  They have increased their prices so they could offer more choices and \"free range eggs\".  \n\nThe result is more fore less.  It's really not the deal it used to be.  I don't think we'll be coming back for breakfast.  It's a shame\n\nOther food is alright, but it's budget food so it's really worth it when it's budget priced.  6.00 for the meatballs isn't worth it, but it's great when they go on sale.  The hotdogs/Ice cream are great, but they don't really hold a candle to Costco.",
        "time": 1484342472
      },
      {
        "aspects": [
          {
            "rating": 3,
            "type": "overall"
          }
        ],
        "author_name": "Songul Wafik",
        "author_url": "https://www.google.com/maps/contrib/107707606760114928311/reviews",
        "language": "en",
        "rating": 5,
        "relative_time_description": "a month ago",
        "text": "IKEA IS AN AWESOME PLACE TO GO FOR FURNITURE SHOPPING, BREAKFAST, SUPPER AND EVEN DINNER! THEIR PRICES ARE SO REASONABLE AND CHEAP! THEY ALSO HAVE AMAZING WORKERS THAT ARE SO POLITE AND PATIENT! THE WAY THEY ORGANIZED THERE STUFF IS INCREDIBLE AND SUPER NEAT! IF YOU ARE MOVING INTO A NEW HOME IKEA IS THE PERFECT PLACE TO GO TO FOR YOUR FURNITURE!",
        "time": 1480181712
      },
      {
        "aspects": [
          {
            "rating": 0,
            "type": "overall"
          }
        ],
        "author_name": "Patrick. Cayer",
        "author_url": "https://www.google.com/maps/contrib/103153268449652861101/reviews",
        "language": "en",
        "profile_photo_url": "//lh4.googleusercontent.com/-42RBnip6Ppc/AAAAAAAAAAI/AAAAAAAAEaI/Kq1wChhM_Fo/s128/photo.jpg",
        "rating": 2,
        "relative_time_description": "in the last week",
        "text": "When shopping for furniture, Ikea is usually one of our first stops due to its great variety and selection as well as their nice showrooms which I give them points for. However when you take in account that nearly every piece of furniture need to be assemble greatly, that they charge a high fee for delivery to the point that it's cheaper to rent a van and that their prices are just a bit less than competitors with free shipping and furniture professionally assemble which lasts longer..... Ikea is really not an intelligent option, it is merely a lazy one, a one stop shop. If you look around at sales or are patient enough to wait for sales at other shops , you will find that they will be a better a option.",
        "time": 1484391497
      },
      {
        "aspects": [
          {
            "rating": 3,
            "type": "overall"
          }
        ],
        "author_name": "Tom Watson",
        "author_url": "https://www.google.com/maps/contrib/114776169148118877307/reviews",
        "language": "en",
        "rating": 5,
        "relative_time_description": "3 months ago",
        "text": "Do not leave your wife alone. If you do you will end up with a new living room set.\n\nSince the renovations the layout has changed, with many more room displays to help you see how things could work together.\n\nGreat availability of the smaller items in the Market Hall....always dangerous for the impulse shopper.\n\nThe food is a GREAT value. Where else can you grab eggs and bacon for $1.00!!!!! Add to that the inexpensive hot-dog, drink, and/or frozen yogurt near the exit and you've got a quick meal that's cheaper than cooking for yourself.",
        "time": 1475845690
      },
      {
        "aspects": [
          {
            "rating": 2,
            "type": "overall"
          }
        ],
        "author_name": "Nic Deland",
        "author_url": "https://www.google.com/maps/contrib/105883866422454814891/reviews",
        "language": "en",
        "profile_photo_url": "//lh6.googleusercontent.com/-gJZEMTyfUzo/AAAAAAAAAAI/AAAAAAAAAUE/cmf62wnPe1U/s128/photo.jpg",
        "rating": 4,
        "relative_time_description": "2 months ago",
        "text": "My wife and I come here often to get ideas to decorate. They sell good everyday products at a great price. If you need something for your house this is the place to start.",
        "time": 1479561651
      }
    ],
