        "profile_photo_url": "//lh5.googleusercontent.com/-OpOHt6i82To/AAAAAAAAAAI/AAAAAAAAR0M/ybGrcxdACL4/s128/photo.jpg",
        "rating": 2,
        "relative_time_description": "a month ago",
        "text": "This place is right next to my work, and I often ask myself \"Why don't I go here more often\" and remember as I'm walking out feeling like crap. This place serves mediocre food at a premium price. The wait staff varies from OK to unattentive. They had a hot dog special where I ordered a 13$ hot dog. I thought \"Wow this must be a pretty fancy hot dog!\". Nope. I am not exaggerating when I say that a hot dog at Costco for 1.50$ tastes a LOT better, and that would have come with a soda. I will always attempt to talk my work out of ever returning for team meals, and hope that the 4-5 times I have been will never be repeated.",
