        "text": "Best Italian restaurant i have ever eaten at, hands down. The food was just amazing. And the staff is incredible. I was thete for new years, and our taxi was late pickung us up before midnight. These guys kept their restaurant open just for us to celebrate the new year at midnight and even gave us a bottle of champagne!!! Will definitely be eating here again. Would give this place a 10 out of 5 if I could.",
