        "text": "I have been going to this location for years as Iive in the neighbourhood. It used to be only mediocre with service and cleanliness but in the past few months it has really impressed me! I don't know if they hired new staff or got new management but the difference in atmosphere and service is outstanding! Definitely the best Tim Hortons in Ottawa. ",
