        "rating": 1,
        "relative_time_description": "9 months ago",
        "text": "Food (soup and bentobox chicken and beef) served cold, sparse portions of chicken teriyaki and steak teriyaki (my wife's meal), lots of onions and thus less meat, felt rushed during meal by server, derogatory remarks from Art, one of the Maitre d\".\nDisappointing since until now my son and us we were  returning customers.",
