        "rating": 1,
        "relative_time_description": "3 months ago",
        "text": "Service was great, waiter was great. Ordered a \"cowboy cut\". Got a rib steak. Told waiter there was an error with my order. Ten minutes later, some drunk looking imbecile stumbles to my table saying \"What's the problem??\"... I asked him who the f he was and if he was looking for a problem, and it turns out he's the manager. When I told him, the manager of a steakhouse, what a cowboy cut was supposed to be, he just kept repeating that that's what I got and I should insult him. Told him to keep his steak and go to an AA meeting. Terrible place to go eat. Plus, the beer was flat.",
