    "reviews": [
      {
        "aspects": [
          {
            "rating": 2,
            "type": "overall"
          }
        ],
        "author_name": "Vikneson Theeson",
        "author_url": "https://www.google.com/maps/contrib/103466400906958645587/reviews",
        "language": "en",
        "profile_photo_url": "//lh6.googleusercontent.com/-G691rklZQcM/AAAAAAAAAAI/AAAAAAAAAIs/9yXER0kMkmA/s128/photo.jpg",
        "rating": 4,
        "relative_time_description": "2 weeks ago",
        "text": "An experience worth having. Service was reasonable, very well-timed and polite. Although I believe our server to be more articulate in French than English. Ambiance was fantastic and the environment - classic. French cuisine is not typically my favourite, but this restaurant has made me enjoy it a bit more! \n\nLobster entree and shrimp appetizer were fantastic. The rabbit appetizer was not for my palette, but the venison entree was delightful. Wine pairing was immaculate, and I believe largely the reason for the five star reviews. Dessert was delicious and beautifully plated.\n\nOverall, a great choice of restaurant in a city where great culinary choices are abundant.",
        "time": 1483197841
      },
      {
        "aspects": [
          {
            "rating": 3,
            "type": "overall"
          }
        ],
        "author_name": "Iguana Jon",
        "author_url": "https://www.google.com/maps/contrib/109356753107977684995/reviews",
        "language": "en",
        "rating": 5,
        "relative_time_description": "a month ago",
        "text": "I ate here on a Sunday night alone at the bar. I had the tasting menu. It was very good. The early dishes, razor clams and others, were good. As the meal progressed, however, it was outstanding.  I did the wine pairing, which was clever. I am on oenophile,  and I was impressed. A few of the choices were not the best in my view (a mets adult would have been better with the poached lobster and sweetbreads) in my view, but it was damn clever.  The staff were exceptionally professional. And I will absolutely go back. This is a first class establishment.",
        "time": 1482120912
      },
      {
        "aspects": [
          {
            "rating": 3,
            "type": "overall"
          }
        ],
        "author_name": "Melanie Wesslock",
        "author_url": "https://www.google.com/maps/contrib/101226283740399281643/reviews",
        "language": "en",
        "profile_photo_url": "//lh4.googleusercontent.com/-Mm0V3kBT75U/AAAAAAAAAAI/AAAAAAAAAEg/QlWmGLdCDtc/s128/photo.jpg",
        "rating": 5,
        "relative_time_description": "a month ago",
        "text": "Exceptional food experience. Well worth the cost. We appreciate the fact that our 9 year old was not treated like a baby - as some waiters tend to do. He loved the food as much as we did. Highly recommend.",
        "time": 1481222927
      },
      {
        "aspects": [
          {
            "rating": 3,
            "type": "overall"
          }
        ],
        "author_name": "Sam Throssell",
        "author_url": "https://www.google.com/maps/contrib/101118652681038545901/reviews",
        "language": "en",
        "rating": 5,
        "relative_time_description": "2 months ago",
        "text": "Incredible experience for my wife and I. We chose to do the tasting menu with the wine pairing. Each dish floored us in its taste and presentation. We wanted a special night for our getaway in Montreal and Bouillon Bilk gave is that and more. Exceptional!",
        "time": 1479684893
      },
      {
        "aspects": [
          {
            "rating": 3,
            "type": "overall"
          }
        ],
        "author_name": "Gray W",
        "author_url": "https://www.google.com/maps/contrib/109012830183623176509/reviews",
        "language": "en",
        "rating": 5,
        "relative_time_description": "3 months ago",
        "text": "Bouillon Bilk is an exceptional restaurant.  My past experiences there have suggested this, but I had it driven home again this week by the contrast with a meal there and at another slightly more expensive restaurant.  Bouillon Bilk had a better atmosphere and better service – with a waiter who ensured you completely understood the dish, rather than just the primary ingredient.  The food at Bouillon Bilk was in another class entirely.  The portions are not large, but quite filling and make it possible to have an appetizer and desert without feeling you’ll explode.  And the balance of the meal is exceptional.  The ingredients complement each other.  There is no side dish that’s randomly glued onto the main, but a complete dish where the flavours and textures combine and play off each other.  Not cheap, but worth every cent.",
        "time": 1474776577
      }
    ],
