        "relative_time_description": "a month ago",
        "text": "Food was good, service was adequate. Should have realized it was an office party night when i saw the 6 square meters of dance floor and the DJ. Will give a good review once I've tried it without the full nightclub experience with the waspy 55-60 years olds.",
