        "text": "I go there one a month with my guys friends because the place is huge aka no waiting time. The selection of dim sum is comparable to the other places. There are also secret menu items you can order such as silk tofu dessert and mix beef organ stew (not for the faint of heart). Usually the cost is around 20$ per person ",
