        "rating": 5,
        "relative_time_description": "in the last week",
        "text": "We have been at 3 brasseurs many times over the years. We have always had a great time, celebrated birthdays or simply went to meet friends. While it does get crowded sometimes, the beer and food they serve is delicious! Oh and the staff is very nice.",
