        "rating": 4,
        "relative_time_description": "2 weeks ago",
        "text": "Went in here for the last hour, got seated at the bar. Despite not getting drinks the bartender was kind enough to serve us. We ended up getting their flatbread (pizzas), which were surprisingly delicious - especially so close during closing. It's great to see that they don't skimp out on quality before closing.",
