        "rating": 4,
        "relative_time_description": "5 months ago",
        "text": "The menu does change and they explore different Tapas which may affect both consistency and whether you will enjoy your choices.  overall at 80% I've enjoyed my meals.  I'd check the menu online and see how it intrigues you at that moment, but they have an array of choices.  \n\nThis is a tapas restaurant so it can be inexpensive like it can be expensive but comparable to other Tapas restos in Montreal",
