    "reviews": [
      {
        "aspects": [
          {
            "rating": 3,
            "type": "overall"
          }
        ],
        "author_name": "Alanna Anstett",
        "author_url": "https://www.google.com/maps/contrib/111852469791836337605/reviews",
        "language": "en",
        "profile_photo_url": "//lh4.googleusercontent.com/-SX0ubCRGgiM/AAAAAAAAAAI/AAAAAAAAACU/YVC3qPmJVTI/s128/photo.jpg",
        "rating": 5,
        "relative_time_description": "a month ago",
        "text": "Room was great with lots of space. Comfortable bed. Hotel was in a great location. Parking is available at a parking lot near the hotel for much cheaper ($20 vs $45 at the hotel) and by staying at the hotel they give you a coupon for the off site parking and it only ended up costing $7.50 for the night.",
        "time": 1482097346
      },
      {
        "aspects": [
          {
            "rating": 3,
            "type": "overall"
          }
        ],
        "author_name": "Peter Truong",
        "author_url": "https://www.google.com/maps/contrib/110166621041078531684/reviews",
        "language": "en",
        "rating": 5,
        "relative_time_description": "a month ago",
        "text": "Amazing location, right at the subway and close to Union Station. The room was lovely, but the atrium view was a bit strange - didn't quite fit with the style of the hotel. Concerage was helpful and friendly.  I would recommend this place to anyone looking for the stay the city. ",
        "time": 1481523043
      },
      {
        "aspects": [
          {
            "rating": 2,
            "type": "overall"
          }
        ],
        "author_name": "Carey Zhang",
        "author_url": "https://www.google.com/maps/contrib/111839078780684026812/reviews",
        "language": "en",
        "profile_photo_url": "//lh6.googleusercontent.com/-FMrV3c8os5k/AAAAAAAAAAI/AAAAAAAAGSM/hU1aomftnDM/s128/photo.jpg",
        "rating": 4,
        "relative_time_description": "a week ago",
        "text": "Parking for the hotel was a bit complicated but the nice thing about the hotel is that it is connected to Toronto's underground PATH system so you can walk indoors and stay warmer even in the winter. The room was nice with a small kitchenette including a microwave and hotplate. My room's sound insulation wasn't the greatest though and I could hear people outside in the hall fairly clearly. The other minor complaint was that the heater was really loud when active (it was winter) but thankfully the heater's controls were easy to you use in the room.",
        "time": 1483754776
      },
      {
        "aspects": [
          {
            "rating": 1,
            "type": "overall"
          }
        ],
        "author_name": "Cole McCallum",
        "author_url": "https://www.google.com/maps/contrib/113335886886962693669/reviews",
        "language": "en",
        "profile_photo_url": "//lh3.googleusercontent.com/-xNbLv5cWFmg/AAAAAAAAAAI/AAAAAAAABHI/dcgBrTbJ06E/s128/photo.jpg",
        "rating": 3,
        "relative_time_description": "a month ago",
        "text": "The space itself is nice. I attended a job fair which was a little over packed and could have used more room, but that is no fault of the hotel.  The King/Yonge location is very convenient both for getting to, as it is right the subway line, and convenient for getting to many big parts of Toronto like Union Station and the Eaton Centre. ",
        "time": 1480572546
      },
      {
        "aspects": [
          {
            "rating": 3,
            "type": "overall"
          }
        ],
        "author_name": "Randy Chin-Cheong",
        "author_url": "https://www.google.com/maps/contrib/105995325282807424395/reviews",
        "language": "en",
        "profile_photo_url": "//lh6.googleusercontent.com/-VlmoTIfixVw/AAAAAAAAAAI/AAAAAAAAADQ/rdLSYNJXkjk/s128/photo.jpg",
        "rating": 5,
        "relative_time_description": "a week ago",
        "text": "The rooms in the tower were modern with an open layout and comfortable furnishings. The view overlooking Toronto was especially breathtaking! Will come again soon.",
        "time": 1483841930
      }
    ],
