        "rating": 5,
        "relative_time_description": "2 months ago",
        "text": "We held our wedding here on Sunday and the wait staff throughout the entire event were super amazing.  We stayed in their honeymoon one bedroom suite and felt like royalty.  Had eggs Benedict for breakfast and they were done perfectly soft poached and the hollandaise was out of this world delicious.  ",
