        "rating": 5,
        "relative_time_description": "2 months ago",
        "text": "I was only there to visit my parents as they were staying there. The room was clean and well kept with modern fixtures. We ordered room service and the food was good, as was the service. My parents said it was a nice place to stay.",
        "time": 1477272562
