    "place_id": "ChIJvUYHUcs0K4gRN8i7jHsUiYs",
    "rating": 4.3,
    "reference": "CmRSAAAAeG3nBi8eFvL4LYWJgkxUSLP24s-i9R5RmPfkq1GhtaY58uN3zL_6bAlUhv2ixGAQHrotHx0-RfATUvjqKVRCe6wQoxDsDsX6-WSkHnmYmkR2c9Iz8S9AeMG4eNEesP0dEhCWCgltpMCRbcM52I7zBYBbGhTkbEMkvDwTgM5AdLInhhoEy7ZVSA",
    "reviews": [
      {
        "aspects": [
          {
            "rating": 1,
            "type": "overall"
          }
        ],
        "author_name": "Geoff Oleszkowicz",
        "author_url": "https://www.google.com/maps/contrib/108273439764438844786/reviews",
        "language": "en",
        "profile_photo_url": "//lh6.googleusercontent.com/-IWGbrv233CU/AAAAAAAAAAI/AAAAAAAALUM/tID6DXCyI7c/s128/photo.jpg",
        "rating": 3,
        "relative_time_description": "2 weeks ago",
        "text": "Went the the day after boxing day and they were very busy. The supposed deals were just items marked up to mark down. We were hungry and wanted a quick bite to eat and it took us 20 Min to fight for a table and another 10 Min to get 4 chairs. The mall was well decorated and I did feel the holiday spirit with some amazing decorations. \n\nThe best part of my visit to the Eaton Centre was that my wife didn't buy anything since they were so busy. Would not go again but was good exercise walking from one side to the other.",
        "time": 1483225742
      },
      {
        "aspects": [
          {
            "rating": 2,
            "type": "overall"
          }
        ],
        "author_name": "Tracy F. Hackshaw",
        "author_url": "https://www.google.com/maps/contrib/112558830650398635855/reviews",
        "language": "en",
        "profile_photo_url": "//lh3.googleusercontent.com/-ab9PpKv3xck/AAAAAAAAAAI/AAAAAAABK7I/0ZL15cJI-Ig/s128/photo.jpg",
        "rating": 4,
        "relative_time_description": "2 weeks ago",
        "text": "Venerable, cavernous Shopping Centre smack in the middle of downtown Toronto. Used to be anchored by a huge and impossibly busy Sears store up to about 2014/15 (even Canadians have rejected Sears). Not as option-filled as the massive Square One in Mississauga, say, but presents reasonable shopping options to those looking to do a quick one-stop shopping and entertainment trip when in the City Centre. The hot dogs outside are pretty decent too. ",
        "time": 1483398774
      },
      {
        "aspects": [
          {
            "rating": 3,
            "type": "overall"
          }
        ],
        "author_name": "Connor Vaivods",
        "author_url": "https://www.google.com/maps/contrib/102468554924993090516/reviews",
        "language": "en",
        "rating": 5,
        "relative_time_description": "a month ago",
        "text": "Good:\nVery well decorated with lots of people taking pictures of the displays (Christmas time).  Too many stores to visit in one day.  Good sales saving my bank account. Additional staff scattered throughout at stationary locations to help direct you through the massive mall. Clean.  Security meandering here and there. Good food located on the bottom floor and little places throughout.  \n\nBad: \nHigher class, so the prices usually follow.  If you're looking to be really thrifty, your options will be limited.  \n\nUgly:\nA couple stores had their alarms going off regularly. It got a little annoying while in those stores, and then sort of stressed me out when I went to leave because it could be a little embarrassing. \n\nOver all:\nGreat experience and I'm looking forward to going back soon. ",
        "time": 1481212168
      },
      {
        "aspects": [
          {
            "rating": 1,
            "type": "overall"
          }
        ],
        "author_name": "Chris Tyler, CAPM",
        "author_url": "https://www.google.com/maps/contrib/117879658168440263181/reviews",
        "language": "en",
        "profile_photo_url": "//lh3.googleusercontent.com/-xQ3ZYoWBhoM/AAAAAAAAAAI/AAAAAAAA4o8/CFKySiKUqvw/s128/photo.jpg",
        "rating": 3,
        "relative_time_description": "2 weeks ago",
        "text": "They have found way to good way to segregate by disposable income. I guess that's good. most \"Flagship\" stores are fairly small. Good location if you live downtown, parking and access is ridiculously expensive.",
        "time": 1483465245
      },
      {
        "aspects": [
          {
            "rating": 1,
            "type": "overall"
          }
        ],
        "author_name": "Brian Truong",
        "author_url": "https://www.google.com/maps/contrib/102624043653173533274/reviews",
        "language": "en",
        "profile_photo_url": "//lh3.googleusercontent.com/-Rq2OmHVjn3k/AAAAAAAAAAI/AAAAAAAAQas/IjzYEI3HQgM/s128/photo.jpg",
        "rating": 3,
        "relative_time_description": "4 weeks ago",
        "text": "Great place for tourist, to take pictures. Especially around this time where they have the huge trees and glowing reindeer. There's also a good selection of mid-high end stores. The mall itself is connected to the PATH system in Toronto so its a lot easier for people to avoid the cold, while wanting to travel around the city.",
        "time": 1482335738
      }
    ],
