        "text": "Mediocre especially for downtown.\nThe spicy tuna was way too spicy not like other restaurants.\nThey served us wooden disposable chopsticks.\nThe dragon and eel roll was a joke. It was way too warm in temperature.\nThe tempura was too greasy. The cooks are all new.  \nThe sashimi was the only good dish.",
