    "reviews": [
      {
        "aspects": [
          {
            "rating": 0,
            "type": "overall"
          }
        ],
        "author_name": "Max Merinov",
        "author_url": "https://www.google.com/maps/contrib/103939276414237163538/reviews",
        "language": "en",
        "profile_photo_url": "//lh3.googleusercontent.com/-ZjbWuWI-jnY/AAAAAAAAAAI/AAAAAAAADbU/Mfa4WX_dVyQ/s128/photo.jpg",
        "rating": 2,
        "relative_time_description": "a month ago",
        "text": "Horrible food. I have been here for two private company events and several times as a regular customer and had the same experience. During one of the events chicken skewers were served RAW on the inside. Another time we came back and one of my colleagues ordered a veggie burger on a gluten free bun. The burger came back on a regular white bun and was so overcooked that she would not cut through it. Server apologized and agreed to give her a new order, which AGAIN came back on a white bun and overcooked. Unbelievable. \n\nI will say however, the venue itself is fine, just need to get a new chef and kitchen staff. Just go for the drinks.",
        "time": 1481482147
      },
      {
        "aspects": [
          {
            "rating": 2,
            "type": "overall"
          }
        ],
        "author_name": "brian mars",
        "author_url": "https://www.google.com/maps/contrib/108849909104646550318/reviews",
        "language": "en",
        "profile_photo_url": "//lh5.googleusercontent.com/-jCebriLTesQ/AAAAAAAAAAI/AAAAAAAAAKI/5BcxawnVa3E/s128/photo.jpg",
        "rating": 4,
        "relative_time_description": "2 weeks ago",
        "text": "Was here this past Friday for a birthday. No cover for a 'club' was nice, and $3 coat check was cheaper than areas around. The live music was awesome, both quality and music choices. Between bowling, Ping Pong and the club portions make it seem like a cool hang out area. Drink were expensive through ($9 for a Sam Adams).",
        "time": 1483389848
      },
      {
        "aspects": [
          {
            "rating": 2,
            "type": "overall"
          }
        ],
        "author_name": "Sitesh Patel",
        "author_url": "https://www.google.com/maps/contrib/102098982021260234736/reviews",
        "language": "en",
        "profile_photo_url": "//lh6.googleusercontent.com/-lqhWDFu5r1g/AAAAAAAAAAI/AAAAAAAACFk/OKios0HzBec/s128/photo.jpg",
        "rating": 4,
        "relative_time_description": "2 months ago",
        "text": "All ways a fun time. The place is a bit pricey but that is expected because of location. The food options are quite nice with a big selection of great appetizers. The bowling is pretty great too. Would recommend for groups of friends.",
        "time": 1479138201
      },
      {
        "aspects": [
          {
            "rating": 0,
            "type": "overall"
          }
        ],
        "author_name": "Clyde Fernandes",
        "author_url": "https://www.google.com/maps/contrib/113073561212332431552/reviews",
        "language": "en",
        "profile_photo_url": "//lh3.googleusercontent.com/-M29leR2lJ_M/AAAAAAAAAAI/AAAAAAAAABc/QgGHZiUYSlk/s128/photo.jpg",
        "rating": 1,
        "relative_time_description": "2 weeks ago",
        "text": "Poor experience here. Ordered the steak sandwich medium rare; it came out well done. Stood at the bar longer than I should have for the bartender to come around. But try using the ping-pong or foosball tables and the staff would pop up quickly to remind you that it's not available for use despite no one else playing. Other half of our party went to bowl and they received minimal service until it was time to get kicked off.",
        "time": 1483218869
      },
      {
        "aspects": [
          {
            "rating": 2,
            "type": "overall"
          }
        ],
        "author_name": "Peter Floyd",
        "author_url": "https://www.google.com/maps/contrib/105814653133968496367/reviews",
        "language": "en",
        "profile_photo_url": "//lh6.googleusercontent.com/-SY8M6wmBqdA/AAAAAAAAAAI/AAAAAAAAATY/d6lrFbfF5KU/s128/photo.jpg",
        "rating": 4,
        "relative_time_description": "a month ago",
        "text": "Pros: Nice place to hang out. Just had a Christmas Party there. There is a separate section for parties with 2 separate bowling alleys, 2 pool tables and a separate bar.\n\nCons: When it was time to leave, we were rudely asked to leave because of another party coming in. \n\nFood and Drinks: Drinks are reasonable for downtown ($7.00 + tip for a rum and coke). Finger foods were ok but not spectacular.",
        "time": 1481335506
      }
    ],
