        "author_name": "Roni L",
        "author_url": "https://www.google.com/maps/contrib/114792415989723621563/reviews",
        "language": "en",
        "rating": 1,
        "relative_time_description": "2 months ago",
        "text": "Sorry but the waitress was rushing me to place an order and it wasn't even busy. I asked the waitress what is the customers choice and she couldnt even suggest anything from their ripped up menu. The place is called Jake's boathouse and they only had haddock for fish and chips and it was the worst fish and chips I ever had. If you enjoy fish and chips do not order it, its so disgusting, the batter was raw. I was being polite to stay and I will never go back.",
