    "reviews": [
      {
        "aspects": [
          {
            "rating": 1,
            "type": "overall"
          }
        ],
        "author_name": "Andrew Teeluck",
        "author_url": "https://www.google.com/maps/contrib/105699967349103203358/reviews",
        "language": "en",
        "profile_photo_url": "//lh6.googleusercontent.com/-LTyrXu4cWQ8/AAAAAAAAAAI/AAAAAAAAHZM/0hVIu8PEQsc/s128/photo.jpg",
        "rating": 3,
        "relative_time_description": "2 weeks ago",
        "text": "An outdoor mall is a great idea... for places that don't get cold in the winter! I was here to see Rogue One at the VIP theatre. A standalone VIP theatre... now that's a great idea. CF Shops got an extra star for that.",
        "time": 1483205486
      },
      {
        "aspects": [
          {
            "rating": 2,
            "type": "overall"
          }
        ],
        "author_name": "Lionel L",
        "author_url": "https://www.google.com/maps/contrib/118143444133786558214/reviews",
        "language": "en",
        "profile_photo_url": "//lh6.googleusercontent.com/-alcgPZzbsVE/AAAAAAAAAAI/AAAAAAAAAKM/Y9wxWVBVJJ4/s128/photo.jpg",
        "rating": 4,
        "relative_time_description": "a week ago",
        "text": "Tough to find parking, but the location itself is very nice. Lots of high end stores and community gathering spaces. A lot of the outdoor spaces are jam packed with people during the summer from morning till very late at night.\n\nThe bars and restaurants are above average, and are great locations to celebrate milestones with friends and family.",
        "time": 1483686643
      },
      {
        "aspects": [
          {
            "rating": 2,
            "type": "overall"
          }
        ],
        "author_name": "Kathleen Davis",
        "author_url": "https://www.google.com/maps/contrib/114258180725372465136/reviews",
        "language": "en",
        "profile_photo_url": "//lh6.googleusercontent.com/-CNUCg9zY9Y0/AAAAAAAAAAI/AAAAAAAAAFw/Wk7pLZlQ5cs/s128/photo.jpg",
        "rating": 4,
        "relative_time_description": "4 weeks ago",
        "text": "Good higher end stores. Great restaurants. The VIP theatre is the highlight for me with all the great places to eat. Its a nice place to spend some time in the summer. This is an outdoor shopping plaza so in the winter it can get cold.",
        "time": 1482347323
      },
      {
        "aspects": [
          {
            "rating": 3,
            "type": "overall"
          }
        ],
        "author_name": "Alex Chu",
        "author_url": "https://www.google.com/maps/contrib/105822319985084111875/reviews",
        "language": "en",
        "rating": 5,
        "relative_time_description": "a month ago",
        "text": "The shopping experience is different than what you would experience anywhere else. It has a very premium feel to the place and each store is it's own, where you would have to walk outside to go into each store. I found this mall has a similar feel to shopping plazas in Taiwan, Japan, or Korea. Definitely different from anything you will find in Toronto.",
        "time": 1482100812
      },
      {
        "aspects": [
          {
            "rating": 3,
            "type": "overall"
          }
        ],
        "author_name": "Keln Huang",
        "author_url": "https://www.google.com/maps/contrib/107432881831752143417/reviews",
        "language": "en",
        "profile_photo_url": "//lh5.googleusercontent.com/-fmJw-CNOPGU/AAAAAAAAAAI/AAAAAAAAABQ/v4ZZk7Jv8mQ/s128/photo.jpg",
        "rating": 5,
        "relative_time_description": "in the last week",
        "text": "Tons of really nice shops here.  Reminds me of a US outlet mall, but without the deep discounts.  They also have a VIP theater there.  Worth checking out once.  Be prepared to spend $25 for a movie.  Worth it if you are going to eat and drink during the show.",
        "time": 1484715587
      }
    ],
