        "rating": 5,
        "relative_time_description": "a month ago",
        "text": "My favourite wing place in Toronto. They only have 10 sauces, but that just makes each sauce better quality. The quality of the actual wing is perfect with a slight dusting of seasoned flour to give it a nice crispness and as mentioned, all sauces are great. You can't go wrong. Order the sauce on side to keep the wings crispier for a longer time. Also get the wedges (and ask for them cooked well done). ",
