    "place_id": "ChIJc0wtaO40K4gR6v-2NnV54XU",
    "rating": 3.7,
    "reference": "CmRRAAAA91C2BFO8a4nZ4sDcXqJER6DNxNRsTM_WErk-frPXvhSHReAkMgyi-5Snb7gFww0__-eLFDfWqSqV45H17NgG9awCo6aARwKDaRD4wx1-bByfMZHfg3OFyAqN2fo6-2n8EhAU7MCpggVorhWgDxQ-MC-kGhTM2l6UHsN-qVYbqLhj9-yVARIwZg",
    "reviews": [
      {
        "aspects": [
          {
            "rating": 2,
            "type": "overall"
          }
        ],
        "author_name": "Nadia Yuen",
        "author_url": "https://www.google.com/maps/contrib/114531373749488945789/reviews",
        "language": "en",
        "rating": 4,
        "relative_time_description": "a month ago",
        "text": "I've been to Marlowe's several times in the past for dinner as well as for work holiday functions. This year, I had the opportunity to organize my department's holiday party and it turned out to be great--thanks for the great service provided by the staff at Marlowe.\n\nI was quite impressed as I hadn't been to the restaurant in at least 3 years prior to last night. The food was good and we had approximately 53 guests served with a three course meal. Although the chicken was somewhat bland, the steak was moist and pasta was flavourful.  The mushroom soup and salads were also hits!\n\nThe atmosphere was great. They permitted the use of their projector throughout the evening for our slide show and a DJ was brought in by the restaurant at around 10pm so that our guests could dance. All in all, a great place to host an event. We will definitely consider this for future work events.\n\nSpecial thanks to the floor and event managers who helped facilitate this event. They were very friendly and provided exceptional service.",
        "time": 1481926038
      },
      {
        "aspects": [
          {
            "rating": 0,
            "type": "overall"
          }
        ],
        "author_name": "Anita Yeung",
        "author_url": "https://www.google.com/maps/contrib/110790340780915832283/reviews",
        "language": "en",
        "rating": 1,
        "relative_time_description": "a month ago",
        "text": "We have our office Christmas dinner at the restaurant.  But the food is quite disappointing especially the seafood and whisky.  The seafood seemed like they have been frozen for ages and not defrosted properly before putting them into the oven.  They are rubbery and have no seafood taste.  The sauce was so salty that I could not finish the whole thing.  I can understand that this is the busiest time of the year, yet the quality of the service and food cannot be sacrificed.  We have ordered the chicken with vegetable soup.  But all orders came out with different portions and different amount of chicken and vegetables.  Some had too much chicken and vegetables while some had nothing but clear broth.  Also, we asked for water, but they gave us sparkling water instead.  We, of course, need to pay for that.  They insisted that they gave us 2 bottles but I could only see one bottle of sparkling water on the table.  \nMy overall opinion is that the only good thing about the restaurant is the bread they serve as they are right out of the oven.",
        "time": 1481815217
      },
      {
        "aspects": [
          {
            "rating": 3,
            "type": "overall"
          }
        ],
        "author_name": "jodi bristow",
        "author_url": "https://www.google.com/maps/contrib/101062473241698413024/reviews",
        "language": "en",
        "rating": 5,
        "relative_time_description": "a month ago",
        "text": "The Marlowe is a great restaurant with amazing and friendly staff. Everyone in our party raved about the food especially the perfectly cooked steak! I will definitely be back to the Marlowe for more delicious food and drinks! Would recommend to anyone for a group gathering, event, simple date night or later in the evening with the dance floor, a party night out.\n\nThanks again to all the staff at the Marlowe for making my dad's retirement such a great success. Steven was so helpful and accommodating, worked with me to make sure the night was so great ",
        "time": 1479931444
      },
      {
        "aspects": [
          {
            "rating": 1,
            "type": "overall"
          }
        ],
        "author_name": "Zach Lau",
        "author_url": "https://www.google.com/maps/contrib/100687033315383624859/reviews",
        "language": "en",
        "profile_photo_url": "//lh4.googleusercontent.com/-SfVkMyN0dYM/AAAAAAAAAAI/AAAAAAAEBJo/J5e7UXUthws/s128/photo.jpg",
        "rating": 3,
        "relative_time_description": "3 weeks ago",
        "text": "Nice play to eat dinner. A bit loud as sound travels very easily throughout the building. Although I was there with a corporate group for lunch, I feel like the waiters and waitresses could do no harm by smiling and being more welcoming. \n\nThe food was decent, steak and chicken choices were moist, while the salmon and the rigotini was a little underwhelming. The mushroom soup appetizer was much tastier than the salad. For dessert, the chocolate lava cake was nice, but a little hard on the outside. ",
        "time": 1482604777
      },
      {
        "aspects": [
          {
            "rating": 3,
            "type": "overall"
          }
        ],
        "author_name": "Steve Rosen",
        "author_url": "https://www.google.com/maps/contrib/107040785083598745807/reviews",
        "language": "en",
        "rating": 5,
        "relative_time_description": "a month ago",
        "text": "We hosted an engagement brunch for our son and future daughter-in-law for 110 guests last weekend at Marlowe's.  The entire experience was first class, start to finish!  We did our planning with Steven, who was totally accommodating and flexible.  The event was managed by Yuri, who was amazing; whatever we asked was done immediately.  The menu was very complete (we did the kosher style brunch) and we had nothing but compliments from our guests.  And to top it off, the pricing was extremely reasonable...  you could pay that price at any venue just to go for a walk-in brunch, never mind getting an entire restaurant to yourself.  As you can tell, we were totally happy with the experience, and would recommend it to anyone looking for a low fuss, well priced celebration.",
        "time": 1480718877
      }
    ],
