        "rating": 2,
        "relative_time_description": "10 months ago",
        "text": "My ribs came out cold.  Sent them back which took them 10 minutes to heat them while the rest of my family eat their meals.  Finally came back but were still cold.  I didn't want to wait again so I didn't send them back again.  After that, nothing was offered as a discount off my bill.  Service like this doesn't warrant a return visit.  ",
