        "relative_time_description": "3 months ago",
        "text": "WORST BAR I HAVE EVER VISITED! NEVER AGAIN! 1. The bouncers we super rude, they tried to grind on me and my friend. We felt extremely violated and disrespected. We came to this bar to have a good time and hang out with our friends, however we left having the worst FREAKING NIGHT!!! Very disappointed. 2. The service was unprofessional and the music that was played did not suit the crowd at all. 3. The crowd consisted of suburban white dad bod creepy men. I could not even walk to the bathroom without getting grabbed or violated multiple times throughout MY NIGHT.  4. I FELT UNSAFE and had to hold on to my purse and my belongings the whole time i was inside the venue.",
