        "rating": 2,
        "relative_time_description": "4 years ago",
        "text": "日本人スタッフがいないので英語がしゃべれないと厳しい。Google翻訳アプリで見せて会話しました。\n英語がわからないと言うだけでスタッフがあまりいい顔せず!!\nカナダはネットが盛んなようでWi-Fiﾙｰﾀｰ持参しましたがﾎﾃﾙなどのWi-Fiを拾ってしまうので厄介でした。\nyoungstreetが近く、ｲｰﾄﾝｾﾝﾀｰまで5分くらいだし 本当にshoppingにはいいかもです。\n 自然とはかけ離れていました。\nアメリカで言えばﾆｭｰﾖｰｸ、日本で言えば東京って感じの都市ですね♪",
        "time": 1358431865
