        "rating": 3,
        "relative_time_description": "a week ago",
        "text": "Expensive for breakfast and the food didn't wow us. He had eggs Benedict and expected them to be amazing since O&B is pretty upscale but was quite disappointed. I had the smoothie bowl and... It was fine but I could make a better one myself and for much less money.",
        "time": 1483888890
