        "language": "en",
        "rating": 2,
        "relative_time_description": "3 weeks ago",
        "text": "We went on Dec 21 as part of our yearly family Downtown walk tradition before Christmas. I thought that a place with such fancy name and fancy item names on the menu was going to have the same outcome on the taste of the food. Didnt happen!! Worst thing is we found it very overpriced. Another of those restaurants in which you go once but not twice.\n",
