        "rating": 5,
        "relative_time_description": "6 years ago",
        "text": "My wife is on diet but she did not have chance to cook for the night. So we went to eat at Subway at this location. The young guys working there made Two heck of a good sandwich. He got mine with all the fixings and Mozzarella cheese. They made a nice, thick melt sub (Turkey, Ham and Bacon) (better than the pictures) with loads of toppings. and the sub artist recommended southwest sauce which was great. My wife's sub was Turkey on a freshly baked Honey oat bread. Courteous service, too. \n\nSo now I've had a nice big sub, I have no dishes, and the sandwich was healthy so I can have a cold beer with no guilt. \n\nWell done, young gentlemen at Subway!\nVery nice operated Subway.",
        "time": 1276630877
