    "rating": 4.2,
    "reference": "CmRRAAAAWnzNT1j7Z6HrJtXpuXhk90pMvSuQzDLBUqw3hq14r1mvgQjtx8OIL-HUJxO9c4RwDYS5cmi2juiiXvwcG1XpEwOV_H5cNVcIUjcu4d7ZJuF2UHZTAHkvQY0KevXmQR6eEhBiSA5ZWgWrlwVM3SeXLoP8GhTQQLEmxthuvoD4Avn8LopFUF4rww",
    "reviews": [
      {
        "aspects": [
          {
            "rating": 3,
            "type": "overall"
          }
        ],
        "author_name": "Morgan F",
        "author_url": "https://www.google.com/maps/contrib/106776335114586084249/reviews",
        "language": "en",
        "profile_photo_url": "//lh3.googleusercontent.com/-9z04wywI5Rg/AAAAAAAAAAI/AAAAAAAArKo/BZxHqf3kce4/s128/photo.jpg",
        "rating": 5,
        "relative_time_description": "a month ago",
        "text": "It's an open secret that the Gardiner is a great alternative to the ROM, especially if you're into ceramics, or not into crowds. Right across from the ROM, it's a smaller, more focused museum that offers great exhibits year round. Top floor is a rotating exhibit, 2nd floor is European/Asian and 1st floor is ancient/contemporary. Saw their 10 different new age Christmas trees last week for the first time which was cute. Definitely worth a visit for locals and tourists alike! ",
        "time": 1482094253
      },
      {
        "aspects": [
          {
            "rating": 3,
            "type": "overall"
          }
        ],
        "author_name": "Cassandra Griffin",
        "author_url": "https://www.google.com/maps/contrib/101778311500297863806/reviews",
        "language": "en",
        "rating": 5,
        "relative_time_description": "a week ago",
        "text": "Amazing ceramics collection! Classes and drop-in times are offered here with highly qualified teachers for people who want to try. Beautiful gift-shop and excellent lecturers.",
        "time": 1484240938
      },
      {
        "aspects": [
          {
            "rating": 3,
            "type": "overall"
          }
        ],
        "author_name": "Charlotte Elder",
        "author_url": "https://www.google.com/maps/contrib/102617916947396551293/reviews",
        "language": "en",
        "profile_photo_url": "//lh3.googleusercontent.com/-L48_mZ-g9QA/AAAAAAAAAAI/AAAAAAAAAEs/6mWwFW7g18M/s128/photo.jpg",
        "rating": 5,
        "relative_time_description": "3 months ago",
        "text": "I always feel so invigorated and inspired when I leave the Gardiner Museum.  The museum has items on three floors, ranging from a wonderful collection of  Central/South American pieces to 20th century modern pieces.  The restaurant food is yummy, a bit pricey but the food is delicious.  \n\nBest tip: The drop in classes on Friday and Saturday are both really popular, see their site for details.  The sign up system should be going online by end of 2016, I heard (not a moment too soon!)  But a great deal to see if you want to see if you're interested before signing up for an actual session. My son and I feel in love with potting with the wheel - so much fun.",
        "time": 1476970185
      },
      {
        "aspects": [
          {
            "rating": 2,
            "type": "overall"
          }
        ],
        "author_name": "Mary Jane Braide",
        "author_url": "https://www.google.com/maps/contrib/106179587272041780546/reviews",
        "language": "en",
        "profile_photo_url": "//lh3.googleusercontent.com/-kyvpfEL-KAw/AAAAAAAAAAI/AAAAAAAAAwM/hCdWmqngPYA/s128/photo.jpg",
        "rating": 4,
        "relative_time_description": "in the last week",
        "text": "A peaceful little gem. Always worth a visit and a sweet shop and cafe too. ",
        "time": 1484346525
      },
      {
        "aspects": [
          {
            "rating": 3,
            "type": "overall"
          }
        ],
        "author_name": "Trevor Prosser",
        "author_url": "https://www.google.com/maps/contrib/117374236507938793119/reviews",
        "language": "en",
        "profile_photo_url": "//lh5.googleusercontent.com/-AMFQ3HsC8Mg/AAAAAAAAAAI/AAAAAAAAXGo/AHGrLy9tAks/s128/photo.jpg",
        "rating": 5,
        "relative_time_description": "2 months ago",
        "text": "Went to see the True Nordic exhibit, which was smaller than I expected but still full of great information and wonderful pieces, both original and contemporary. The rest of the museum is a treasure trove of pottery, and definitely worth the visit!",
        "time": 1479403166
      }
    ],
